import React, { Component } from 'react';
import { reduxForm, Field } from 'react-dom';
export default class SignUp extends Component {
    render() {
        return (
            <div>
                <form>
                    <fieldset>
                        <Field
                            name="email"
                            type="text"
                            id="email"
                            Component="input" />
                    </fieldset>
                    <fieldset>
                        <Field
                            name="password"
                            type="password"
                            id="password"
                            Component="input" />
                    </fieldset>

                    <button type="submit">Sign Up</button>
                </form>
            </div>
        );
    }
}
